import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import { useState, useMemo } from "react";
import {
  matchPriceRange,
  matchCapacity,
} from "../../helper/flightFilterHelper";

export default function Results() {
  const { results = {}, form = {} } = useSelector(
    (state) => state.search || {}
  );

  const { priceFilters = ["All"], capacityFilters = ["All"] } = useSelector(
    (state) => state.filters || {}
  );

  const outbound = results?.outboundFlights || [];
  const returnF = results?.returnFlights || [];

  const [selectedOutbound, setSelectedOutbound] = useState(null);
  const [selectedReturn, setSelectedReturn] = useState(null);

  const calculateTotalPrice = (flight) => {
    const flyingCostHead = flight.priceHeads?.find(
      (heads) => heads.head === "68a2c4d345a4c290c0959fe5"
    );
    const travelHours = (Number(flight.travelTime + 30) || 0) / 60;
    const flyingCostTotal = (Number(flyingCostHead?.amount) || 0) * travelHours;
    return flyingCostTotal;
  };

  const filtered = useMemo(() => {
    const filterSet = (flights) => {
      if (!priceFilters.includes("All")) {
        flights = flights.filter((flight) =>
          priceFilters.some((range) =>
            matchPriceRange(calculateTotalPrice(flight), range)
          )
        );
      }

      if (!capacityFilters.includes("All")) {
        flights = flights.filter((flight) =>
          capacityFilters.some((range) =>
            matchCapacity(Number(flight.capacity || 0), range)
          )
        );
      }

      return flights;
    };

    return {
      outbound: filterSet([...outbound]),
      return: filterSet([...returnF]),
    };
  }, [results, priceFilters, capacityFilters]);

  return (
    <div className="container ptb50">
      <div className="flight-results">
        {/* --- OUTBOUND LIST SECTION --- */}
        <div className="listing-box">
          <h3 style={{ marginBottom: "15px" }}>
            {results.tripType === "round"
              ? "Select Departure Flight"
              : "Available Flights"}
          </h3>

          {filtered.outbound?.length ? (
            filtered.outbound.map((flight) => (
              <div
                key={flight._id}
                className={`listing-row ${
                  selectedOutbound?._id === flight._id ? "selected-flight" : ""
                }`}
              >
                <div className="flight-box">
                  <div className="flight-title">
                    {flight.name} ({flight.code})
                  </div>
                  <div className="flight-meta">
                    Seats: {flight.capacity} | Max Speed: {flight.maxSpeed} km/h
                  </div>
                  <div className="flight-time">
                    Travel Time: {flight.travelTime} mins
                  </div>
                </div>

                <div className="price">
                  <div className="label">Price</div>
                  <div className="amount">
                    ₹ {calculateTotalPrice(flight).toLocaleString()}
                  </div>
                  <button
                    className="btn btn-fill"
                    onClick={() => setSelectedOutbound(flight)}
                  >
                    {selectedOutbound?._id === flight._id
                      ? "Selected"
                      : "Select"}
                  </button>
                </div>
              </div>
            ))
          ) : (
            <div className="nomore-records">No matching flights found</div>
          )}
        </div>

        {/* --- RETURN LIST (only for round trip) --- */}
        {results.tripType === "round" && (
          <div className="listing-box" style={{ marginTop: "40px" }}>
            <h3 style={{ marginBottom: "15px" }}>Select Return Flight</h3>

            {filtered.return?.length ? (
              filtered.return.map((flight) => (
                <div
                  key={flight._id}
                  className={`listing-row ${
                    selectedReturn?._id === flight._id ? "selected-flight" : ""
                  }`}
                >
                  <div className="flight-box">
                    <div className="flight-title">
                      {flight.name} ({flight.code})
                    </div>
                    <div className="flight-meta">
                      Seats: {flight.capacity} | Max Speed: {flight.maxSpeed}{" "}
                      km/h
                    </div>
                    <div className="flight-time">
                      Travel Time: {flight.travelTime} mins
                    </div>
                  </div>

                  <div className="price">
                    <div className="label">Price</div>
                    <div className="amount">
                      ₹ {calculateTotalPrice(flight).toLocaleString()}
                    </div>
                    <button
                      className="btn btn-fill"
                      onClick={() => setSelectedReturn(flight)}
                    >
                      {selectedReturn?._id === flight._id
                        ? "Selected"
                        : "Select"}
                    </button>
                  </div>
                </div>
              ))
            ) : (
              <div className="nomore-records">No return flights found</div>
            )}
          </div>
        )}

        {/* --- CONTINUE BUTTON --- */}
        <div className="text-center mt-4">
          {results.tripType === "round"
            ? selectedOutbound &&
              selectedReturn && (
                <Link
                  className="btn btn-fill"
                  to={`/checkout?out=${selectedOutbound._id}&ret=${selectedReturn._id}`}
                >
                  Continue
                </Link>
              )
            : selectedOutbound && (
                <Link
                  className="btn btn-fill"
                  to={`/checkout?out=${selectedOutbound._id}`}
                >
                  Continue
                </Link>
              )}
        </div>
      </div>
    </div>
  );
}
